var presentFinalScreen = function() {

  var interactionContainer = $("#interactionContainer");
  var imageContainer = $("#imageContainer");
  
  interactionContainer.removeChild($(".starRatingContainer"));

  lowerOverlay = $.set($('.overlay'),
  {
    className: 'overlay lowerOverlay'
  });

  var oldGameMessage = $('#gameMessage');
  oldGameMessage.innerHTML = '';
  
  if (ratingCopy.resultMessageHeader.length > 32) {
    var changeToSmallText = $.set(oldGameMessage, {
      className: 'gameMessage gameMessageSmallText'
    });
  }
  else {
    var changeToSmallText = $.set(oldGameMessage, {
      className: 'gameMessage'
    });
  }


  var resultMessageHeader = $.set(oldGameMessage, {
    contents: ratingCopy.resultMessageHeader
  });

  var emailSubmitForm = $.create('form', {
    id: 'emailSubmitForm',
    contents: [
      {
        tag: 'label',
        id: 'resultMessageText',
        contents: ratingCopy.resultMessageText
      },
      {
        tag: 'input',
        id: 'emailFormInput',
        type: 'text',
        'placeholder': 'myemail@myemailprovider.com'
      },
      {
        tag: 'input',
        type: 'submit',
        id: 'emailFormButton',
        value: ratingCopy.emailFormButtonText
      }
    ]
  });

  interactionContainer.append(emailSubmitForm);

  var submitButton = $('#emailFormButton').addEventListener('click', function()
  {
    var input = $('#emailFormInput');

    var email = input.value;

    $.fetch('http://private-bc5f06-stylepoints.apiary-mock.com/emails',
    {
      method: "POST"
    }).then(function()
    {
      input.value = "";
    });
  });
}

var animateExit = function() {
  var gameImages = $$('.gameImageDiv');

  for (image in gameImages)
  {
    
    if (image == index)
    {
      
      slideRight = $.transition(gameImages[image - 1], 
      {
          left: "500px",
          transition: "left 1s"
      });

      
      showNext = $.style(gameImages[image],
      {
          "z-index": -200 * index,
          "display": "block"
      });

    }
  }

}

var gameMessageTextType = function(message) {
  console.log(message.length);
  if (message.length < 30) {
    return "gameMessage"
  } else if (message.length > 30 && message.length < 35 ) {
    return "gameMessage gameMessageMediumText"
  } else {
    return "gameMessage gameMessageSmallText"
  }


}

var nextQuestion = function() {

  $('#additionalText').innerHTML = '';

  console.log('answer1', answer1, 'answer2', answer2, 'answer3', answer3);
  index++;

  console.log(index, 'index');

  var gameMessage = $('#gameMessage');

  var gameImages = $$('.gameImageDiv');


  if (index === 1) {

    animateExit();

    gameMessage.innerHTML = '';

    var setText = $.set(gameMessage, {
      className: gameMessageTextType(ratingCopy.gameMessageTextOne),     
      contents: ratingCopy.gameMessageTextOne
    });
    
  }

  if (index === 2) {

    animateExit();    
    gameMessage.innerHTML = '';

    var setText = $.set(gameMessage, {
      className: gameMessageTextType(ratingCopy.gameMessageTextTwo),     
      contents: ratingCopy.gameMessageTextTwo
    });

  }

  if (index === 3) {

    animateExit();

    gameMessage.innerHTML = '';

    var setText = $.set(gameMessage, {
      className: gameMessageTextType(ratingCopy.gameMessageTextThree),     
      contents: ratingCopy.gameMessageTextThree
    });
  }
  
  
  if (index === 4) {
    animateExit();
    presentFinalScreen();
  } 

  setTimeout(function()
  {
    for (star in $$('.starRating'))
    {
      $.set($$('.starRating')[star], 
      {
        className: 'starRating'
      });
    }
  }, 400);

}

var highlightStars = function(event) {
  console.log( event );
  var stars = $$('.starRating');

  for (star in stars) {

    if (stars[star].id <= event.id)
    {
      console.log('Highlighting');
      $.set(stars[star], {
        className: 'starRating highlightStar'
      });
    }
  }

  var answer = event.id.substring(10,11);
  
  if (answer !== 0 && answer !== 5)
  {
    console.log(answer);
  }

  if (index === 1)
  {
    answer1 = answer;
  }
  else if (index === 2)
  {
    answer2 = answer;
  }
  else if (index === 3)
  {
    answer3 = answer;
  }

  nextQuestion()

}

var buildGameDom = function() {

  
  index++;
  console.log(index, 'index');

  var interactionContainer = $('#interactionContainer');

  $('#additionalText').innerHTML = '';
  var showInstructions = $.set($('#additionalText'),
  {
    contents: [ratingCopy.instruction],
    className: 'additionalText pushDown'
  });

  var starRatingContainer = $.create('div', 
  {
    className: 'starRatingContainer',
  });

  for (var i = 1; i < 6; i++)
  {
    var starRatingInput = $.create('div',
    {
      id: 'starRating' + i,
      'className': 'starRating'
    });

    var selectRating = starRatingInput.addEventListener('click', function(event){
      highlightStars(event.target);
    });
    starRatingContainer.append(starRatingInput);
  }


  for (var i = 1; i <= 5; i++)
  {
    var gameImageDiv = $.create('div', {
    contents: [{
        className: 'gameImage',
        src: ratingCopy.gameImage + i,
        'tag': 'img',
        }], className: 'gameImageDiv',
      style: {
          display: 'block',
          "z-index": -1
        }
    });
  }

  var gameImageDiv = $.create('div', {
    contents: [{
        className: 'gameImage',
        src: ratingCopy.gameImage1,
        'tag': 'img',
        }], className: 'gameImageDiv',
      style: {
          display: 'block',
          "z-index": -1
        }
    });
  var gameImageDiv2 = $.create('div', {
    contents: [{
        className: 'gameImage',
        src: ratingCopy.gameImage2,
        'tag': 'img'
      }], className: 'gameImageDiv'
    }); 
  var gameImageDiv3 = $.create('div', {
    contents: [{
        className: 'gameImage',
        src: ratingCopy.gameImage3,
        'tag': 'img'
      }], className: 'gameImageDiv'
    }); 
  var gameImageDiv4 = $.create('div', {
    contents: [{
        className: 'gameImage',
        src: ratingCopy.resultImage,
        'tag': 'img'
      }], className: 'gameImageDiv'
    });

  var gameImageDivs = [gameImageDiv, gameImageDiv2, gameImageDiv3, gameImageDiv4];
  
  for (image in gameImageDivs) 
  {
    imageContainer.append(gameImageDivs[image]);
  }
  interactionContainer.removeChild( $('#ctaButton') );


  oldMessage = $('#callToAction');
  oldMessage.innerHTML = '';



  var gameMessage = $.set($('#callToAction'), {
    id: 'gameMessage',
    contents: ratingCopy.gameMessageTextOne,
    className: gameMessageTextType(ratingCopy.gameMessageTextOne)
  });
  
  
  interactionContainer.append(starRatingContainer);

  
  
}

var buildInitialDom = function() {
  var mainContainer = $('#rating-container');
  var gameContainer = $.create('div', {
    id: 'gameContainer'
  });
  var imageContainer = $.create('div', {
    id: 'imageContainer'
  });
  var initialGameImage = $.create('div', {
    contents: [{
        className: 'gameImage',
        src: ratingCopy.initialImage,
        'tag': 'img'
      }], className: 'gameImageDiv', style: { "display": "block" }
  });

  var overlay = $.create('div', {
    className: 'overlay'
  });

  

  var interactionContainer = $.create('div', {
    id: 'interactionContainer'
  });
  var callToAction = $.create('div', {
    id: 'callToAction',
    contents: ratingCopy.callToActionMessage
  });
  var additionalText = $.create('p', {
    id: 'additionalText',
    contents: ratingCopy.additionalText
  });
  var ctaButton = $.create('button', {
    id: 'ctaButton', 
    contents: ratingCopy.callToActionButtonText
  });

  mainContainer.append(gameContainer);
  
  gameContainer.append(imageContainer);

  imageContainer.append(initialGameImage);

  imageContainer.append(overlay);
  
  interactionContainer.append(additionalText);
  interactionContainer.append(callToAction);
  interactionContainer.append(ctaButton);
  gameContainer.append(interactionContainer);

  ctaButton.addEventListener('click', function(event) {
    slideRight = $.transition(initialGameImage, 
    {
        left: "500px"
    });

    buildGameDom();

  });
}

buildInitialDom();










